import React from 'react';

const todoItem = (props) => {
        return (
            <li className="listItem">
                {props.name}
                <button onClick={props.deleteItem}>Delete</button>
                <button>Modify</button>
                <button>Done</button>
            </li>
        );
}

export default todoItem;
